  email: state.user.email,
  name: state.user.name,
  address: state.user.address,
  skills: state.user.skills
});
const mapDispatchToProps = dispatch => {
  return {
    logout: () => {
      dispatch(actions.logOut());
    },
    getUser: () => {
      dispatch(actions.getUser());
    }
  };
};
export default connect(
  mapStateToProps,
  mapDispatchToProps
